//Bobols
setInterval(()=>{

    if(localStorage.getItem('Bobols')===null){
        localStorage.setItem('Bobols',1)

    }else{
        document.querySelector('.coinsClickButton_container').style.backgroundImage=`url(${coinBobols[localStorage.getItem('Bobols')]})`;

    }



    

    if(localStorage.getItem('Bobols')==='1'){

        document.querySelector(`.MarkIconBobols1`).style.opacity=1;
        document.querySelector(`.MarkIconBobols2`).style.opacity=0;
        document.querySelector(`.MarkIconBobols3`).style.opacity=0;
        document.querySelector(`.MarkIconBobols4`).style.opacity=0;

    }else if(localStorage.getItem('Bobols')==='2'){

        document.querySelector(`.MarkIconBobols1`).style.opacity=0;
        document.querySelector(`.MarkIconBobols2`).style.opacity=1;
        document.querySelector(`.MarkIconBobols3`).style.opacity=0;
        document.querySelector(`.MarkIconBobols4`).style.opacity=0;

    }else if(localStorage.getItem('Bobols')==='3'){

        document.querySelector(`.MarkIconBobols1`).style.opacity=0;
        document.querySelector(`.MarkIconBobols2`).style.opacity=0;
        document.querySelector(`.MarkIconBobols3`).style.opacity=1;
        document.querySelector(`.MarkIconBobols4`).style.opacity=0;

    }else if(localStorage.getItem('Bobols')==='4'){

        document.querySelector(`.MarkIconBobols1`).style.opacity=0;
        document.querySelector(`.MarkIconBobols2`).style.opacity=0;
        document.querySelector(`.MarkIconBobols3`).style.opacity=0;
        document.querySelector(`.MarkIconBobols4`).style.opacity=1;

    }

},100)



//realCoins_mainContainer_bobolsImg
const realCoins_mainContainer_bobolsImg=document.querySelectorAll('.realCoins_mainContainer_bobolsImg');
realCoins_mainContainer_bobolsImg.forEach((e)=>{
    e.addEventListener('click',()=>{

        let dataDashed_Id=e.dataset.id;
        let Amount=e.dataset.amount;
        let AmountBuyConvertToCoins=(Number(Amount)*80000).toFixed(0);
        
        
        if(Number(localStorage.getItem('displayCoins'))>Number(AmountBuyConvertToCoins)){
            let getItem=Number(localStorage.getItem('displayCoins'));
            localStorage.setItem('displayCoins',getItem-Number(AmountBuyConvertToCoins))

        
            if(dataDashed_Id==='Bobols1'){
                localStorage.setItem('Bobols',1)
            }else if(dataDashed_Id==='Bobols2'){
                localStorage.setItem('Bobols',2)
            }else if(dataDashed_Id==='Bobols3'){
                localStorage.setItem('Bobols',3)
            }else if(dataDashed_Id==='Bobols4'){
                localStorage.setItem('Bobols',4)
            }


            localStorage.setItem('coinsContainerBottomI',0)
            localStorage.setItem('coinsContainerBottomII',0)
                    
            coinsContainer_coinsI.style.opacity=1;
            coinsContainer_coinsIII.style.opacity=1;
            coinsContainer_coinsV.style.opacity=1;
            coinsContainer_coinsVII.style.opacity=1;
            coinsContainer_coinsIX.style.opacity=1;
            coinsContainer_coinsII.style.opacity=1;
            coinsContainer_coinsIV.style.opacity=1;
            coinsContainer_coinsVI.style.opacity=1;
            coinsContainer_coinsVIII.style.opacity=1;
            coinsContainer_coinsX.style.opacity=1;
        }else{
            document.querySelector('.displayMessage').style.display='block';
            document.querySelector('.displayMessage').innerText='insufficient balance';
            setTimeout(()=>{
                document.querySelector('.displayMessage').style.display='none';
            },1000)
        }
        
    })
})

















